        return(
            <Select defaultValue="Select" style={{ width: 170 }} >
                                <Option value="Temperature">Temperature</Option>
                                <Option value="Pressure">Pressure</Option>
                                <Option value="Humidity">Humidity</Option>
                                <Option value="Wind Direction">Wind Direction</Option>
                                <Option value="Wind Speed">Wind Speed</Option>

                                {/* TASK 3: Take a look at Dataset Information.md from MS1 and add other options to the selector here  */}
                            </Select>
        )
    }
}

export default TempAttrDropdown
